import React from 'react'; // Importa React
import { Link } from 'react-router-dom'; // Importa 'Link' para manejar la navegación sin recargar la página
import './Navbar.css'; // Importa el archivo CSS con los estilos del Navbar

const Navbar = () => {
  return (
    <nav className="navbar"> {/* Contenedor del Navbar */}
      <ul className="navbar-links"> {/* Lista de enlaces */}
        <li className="navbar-item"> {/* Elemento de lista para el enlace 'Home' */}
          <Link to="/" className="navbar-link">Home</Link> {/* Enlace a la página principal */}
        </li>
        <li className="navbar-item">
          <Link to="/recipes" className="navbar-link">Recipes</Link> {/* Enlace a la página de recetas */}
        </li>
        <li className="navbar-item">
          <Link to="/services" className="navbar-link">Services</Link> {/* Enlace a la página de servicios */}
        </li>
        <li className="navbar-item">
          <Link to="/restaurant" className="navbar-link">Restaurant</Link> {/* Enlace a la página del restaurante */}
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
